    <script>
      (function() {
        var graph = new Zinc.Graph({
          axes: {
            x: {
              id: 'duration',
              label: 'Latency (in ms)'
            },
            y: {
              id: 'created_at',
              label: 'Created'
            }
          },

          parse: function(json) {
            return json.map(function(item) {
              var converted = new Date(item.converted_at),
                  created = new Date(item.created_at);

              return {
                duration: converted.getTime() - created.getTime(),
                created_at: created
              };
            });
          }
        });

        graph.load(DATA);
      }());
